import React, {SetStateAction} from "react";
import cn from 'classnames';

interface Props {
    agreeOpen : boolean;
    setAgreeOpen : React.Dispatch<SetStateAction<boolean>>;
}
export function Agree({agreeOpen, setAgreeOpen} : Props){
    return(
        <div className='absolute z-50 w-full h-[678px]'>
            <div className={cn('z-50 bg-white absolute transition-all duration-500 ease-in-out', {
                'w-[0px]': !agreeOpen,
                'w-full': agreeOpen,
            })}>
                <button onClick={(e: React.MouseEvent<HTMLButtonElement>) => setAgreeOpen(false)}>닫기</button>
            </div>
        </div>
    )
}
